import React from "react";
import styled from "styled-components";


const Body = styled.div`
    width: 100%;
    height: 100px;
    background-color: white;


`
const Logo = styled.img`


`




const Header = () => {


    return(
        <Body>
            <Logo />
        </Body>
    )
}

export default Header;
